        <Routes>
          <Route path="/" element={<LoginPage />} />
          <Route path="/home/*" element={<MainPage />}>
            <Route path="home-page" element={<ProtectedRoute element={<HomePage />} />} />
            <Route path="profile" element={<ProtectedRoute element={<Profile />} />} />
